import React, { Component } from 'react'




// import { Route } from "react-router-dom"
// import Imga from "../images/1.jpg"
import { Link } from "react-router-dom"
import { throwStatement } from '@babel/types';



export default class Studentpprofile extends Component {
    constructor(props) {
        super(props)

        this.state = {
            visible:false,
            
            namelit: [],
            agelist: [],
            unilist: [],
            collegelist: [],
            subjectslist: []

        };
    };

    handleFormSubmit = (e) => {

        e.preventDefault();
        let items = [...this.state.items];
        items.push({
          username: this.state.username
        });
        this.setState({
          items,
          username: '',
        });
      };
      
      handleInputChange = (e) => {
        this.setState({
          username: e.target.value
        })
      }

    // handlechange = (e) => {
    //     this.setState({
            
    //         [e.target.name]: e.target.value,
    //         [e.target.age]: e.target.value,
    //         [e.target.uni]: e.target.value,
    //         [e.target.college]: e.target.value,
    //         [e.target.subjects]: e.target.value,
    //     })
         
     
    // }
    // handlesubmit=(e)=>{
    //     e.preventDefault();
       
    //    this.setState({
    //        visible:true
    //    })

    // }

    render() {
        return (
            <div>
                <div>
                    <div className="studentprofile">
                        <br />
                        <div className="stddiv">

                            <label><h2>students details</h2></label>
                            <form onSubmit={this.handlesubmit.bind(this)}>
                                <input type="text"
                                    name="name"
                                    placeholder="fullname"
                                    value={this.state.name}
                                    onChange={this.handlechange.bind(this)}
                                    required />
                                <br />

                                <input
                                    type="text"
                                    name="age"
                                    required
                                    placeholder="age"
                                    value={this.state.age}
                                    onChange={this.handlechange.bind(this)} />
                                <br />

                                <input type="text"
                                    name="uni"
                                    placeholder="university"
                                    value={this.state.uni}
                                    required
                                    onChange={this.handlechange.bind(this)} />
                                <br />

                                <input type="text"
                                    name="college"
                                    placeholder="college"
                                    value={this.state.college}  
                                    required                                  
                                    onChange={this.handlechange.bind(this)} />
                                <br />

                                <input type="text"
                                    name="subjects"
                                    placeholder="subjects"
                                    required
                                    value={this.state.subjects}
                                    onChange={this.handlechange.bind(this)} />
                                <br />
                                <input type="submit" value="Login" />
                            </form>

                        </div>


                        <div>
                            <br />
                            <br />
                            <br />
                            <br />
                            <Link to="/company/allcompanydata">

                                <button className="click">companies data</button>
                            </Link>
                            <br />
                            <br />
                            <Link to="/student/allstudentdata">

                                <button className="click">student data</button>
                            </Link>

                        </div>

                    </div>
                    {this.state.visible ? <div className="datashow">
                        <div className="datashowb">
                            <br />
                            <p className="p">name: {this.state.name}</p>
                            <p className="p">age: {this.state.age}</p>
                            <p className="p">uni: {this.state.uni}</p>
                            <p className="p">college: {this.state.college}</p>
                            <p className="p">subjects: {this.state.subjects}</p>
                            <br />
                        </div>
        </div> :null}  


                </div>
                {/* <div className="datashow">
                   <p>{this.state.name}</p>
                    <p>{this.state.age}</p>
                    <p>{this.state.uni}</p>
                    <p>{this.state.college}</p>
                    <p>{this.state.subjects}</p>
                   </div>  */}


            </div>
        )
    }
}
